export default function Dashboard(){
    const logout = () => {
        //alert("Loggin out ... ");
        sessionStorage.removeItem('userID');
        window.location.href = '/login';
    }

    return(
        <div className="container d-flex flex-column gap-1" style={{minHeight:'60vh'}}>
            <h1>Dashboard</h1>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Etiam aliquet lobortis erat ac ultrices. Aenean varius, urna ut imperdiet vulputate, dui mi mattis sapien, nec vulputate velit libero eu metus. Fusce congue dictum pretium. Suspendisse in suscipit mi, et bibendum neque. Quisque in purus id ex rutrum ultricies ac eu risus. Duis in sem pretium, mattis odio eget, iaculis augue. Mauris ut posuere urna, ut ultricies dolor. Pellentesque consectetur rutrum metus vitae pretium. Nullam id consequat tortor. Quisque cursus quam a iaculis laoreet.</p>
            <span>
                <LogoutButton/>
            </span>
        </div>
    );
    
    function LogoutButton(){
        return(
            <button onClick={logout} className="btn btn-danger">Logout</button>
        );
    }
}
